package dto;

public class Game {
	
	
	public Game() {
		// TODO Auto-generated constructor stub
	}
	
	private int Gno;
	private int Gfirst;
	private int Gsecond;
	private int Gthird;
	private int Gfourth;
	
	
	public Game(int gno, int gfirst, int gsecond, int gthird, int gfourth) {
		super();
		Gno = gno;
		Gfirst = gfirst;
		Gsecond = gsecond;
		Gthird = gthird;
		Gfourth = gfourth;
	}


	public int getGno() {
		return Gno;
	}


	public void setGno(int gno) {
		Gno = gno;
	}


	public int getGfirst() {
		return Gfirst;
	}


	public void setGfirst(int gfirst) {
		Gfirst = gfirst;
	}


	public int getGsecond() {
		return Gsecond;
	}


	public void setGsecond(int gsecond) {
		Gsecond = gsecond;
	}


	public int getGthird() {
		return Gthird;
	}


	public void setGthird(int gthird) {
		Gthird = gthird;
	}


	public int getGfourth() {
		return Gfourth;
	}


	public void setGfourth(int gfourth) {
		Gfourth = gfourth;
	}
	
	
	
}
